<!DOCTYPE html>
<html>
<head>
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    <title>commercetools-sync-java: Benchmarks</title>
    <script src="assets/js/chart.js"></script>
    <link rel="stylesheet" type="text/css" href="assets/css/chart-animation.css">
    <link rel="stylesheet" type="text/css" href="assets/css/benchmarks.css">
</head>

<body cz-shortcut-listen="true">
<div id="container" style="width: 100%;">
    <div class="chartjs-size-monitor"
         style="position: absolute; left: 0px; top: 0px; right: 0px; bottom: 0px; overflow: hidden; pointer-events: none; visibility: hidden; z-index: -1;color: wheat">
        <div class="chartjs-size-monitor-expand"
             style="position:absolute;left:0;top:0;right:0;bottom:0;overflow:hidden;pointer-events:none;visibility:hidden;z-index:-1;">
            <div style="position:absolute;width:1000000px;height:1000000px;left:0;top:0"></div>
        </div>
        <div class="chartjs-size-monitor-shrink"
             style="position:absolute;left:0;top:0;right:0;bottom:0;overflow:hidden;pointer-events:none;visibility:hidden;z-index:-1;">
            <div style="position:absolute;width:200%;height:200%;left:0; top:0"></div>
        </div>
    </div>
    <canvas id="canvas" width="1428" height="714" class="chartjs-render-monitor"
            style="display: block; width: 1428px; height: 714px;"></canvas>
</div>

<script src="assets/js/chart-renderer.js"></script>
<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.2.1/jquery.min.js"></script>

</div>
</body>
</html>
